import React from 'react';
import './NavBar.css';

const Button = (props) => (
    <button className='NavBar-onebutton' onClick={props.clicked}>
        {props.children}
    </button>
);

var ExpandingButton;
ExpandingButton = (props) => 
    {isLoggedIn ? (
        <LogoutButton onClick={this.handleLogoutClick} />
      ) : (
        <LoginButton onClick={this.handleLoginClick} />
      )}


export {
    Button,
    ExpandingButton,
}
